import Layout from '../components/Layout';
import Fetch from "isomorphic-unfetch"

const Bitz = () => (
  <Layout>
    <div>
      <h1>Prices</h1>
    </div>
  </Layout>
);

Bitz.getInitialProps = async function () {
    const res = await fetch("https://api.coindesk.com/v1/bpi/currentprice.json");
}

export default Bitz;
